import React from 'react';


const TodoItems = (props) => {
	console.log(props);
	return (

		<li key={props.todo.id} className='list-group-item form-group'>
			<div className='checkbox'>
				<input type='checkbox' onChange={handleChange} name='check'  checked={props.todo.completed} />
				<label className=''> {props.todo.title} </label>
			</div>
		</li>
	)
}

export default TodoItems
